import { AxiosInstance } from "axios";
import { User } from "../types/models/User.model";

type AddMovieRequest = {
  Title: string;
  ReleaseDate: string | null;
 
};

export type Image_Post = {
  id: number;
  image: string;
  description: string;
  likes: number;
  author: User;
};


const  MovieService = (api: AxiosInstance = defaultAxiosInstatnstace) => ({
  getMovieById: async (id: number) => {
    const data = await api.get(`/movies/${id}`);
    console.log(data);
    return data.data;
    
  },
  getMovies: async () => {
    const data = await api.get<MovieType[]>("/movies");
    return data.data;
  },
  createMovie: async (params: AddMovieRequest) => {
    const res = await api.post("/movies", params);
    if (res && res.status === 200) {
      console.log("movie successfully created");
    }
  },
  removeMovie: async (id: number) => {
    const res = await api.delete(`/movies/${id}`);
    if (res && res.status === 200) {
      console.log("movie successfully deleted");
    }
  },
  updateMovie: async (params: Movie) => {
    const res = await api.put(`/movies/${params.id}`, {...params, "Release Date": params.ReleaseDate});
    if (res && res.status === 200) {
      console.log("movie successfully updated");
    }
  },
});

export default MovieService;
